import React, { useState } from 'react';
import logo from '../../logo.svg'
import './addTiffinCenter.css';




const AddTiffinCenter = () => {
  const [formData, setFormData] = useState({
    tiffinCenterName: "",
    ownerName: "",
    contactNumber: "",
    address: "",
    email: "",
    subscriptionType: "weekly", // Default to 'weekly'
    deliveryAreas: "",
    description: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };
  const handleSubmit = (e) => {
    e.preventDefault();
    // Submit formData to your backend or Firebase
    console.log("Form Submitted", formData);
  };

  return (
    <div className="profile-form-container">
      <h2>Register Your Tiffin Center</h2>
      <form onSubmit={handleSubmit} className="profile-form">
        <div className="form-group">
          <label htmlFor="tiffinCenterName">Tiffin Center Name:</label>
          <input
            type="text"
            id="tiffinCenterName"
            name="tiffinCenterName"
            value={formData.tiffinCenterName}
            onChange={handleChange}
            required
            className="form-control"
          />
        </div>
        <div className="form-group">
          <label htmlFor="ownerName">Owner Name:</label>
          <input
            type="text"
            id="ownerName"
            name="ownerName"
            value={formData.ownerName}
            onChange={handleChange}
            required
            className="form-control"
          />
        </div>
        <div className="form-group">
          <label htmlFor="contactNumber">Contact Number:</label>
          <input
            type="text"
            id="contactNumber"
            name="contactNumber"
            value={formData.contactNumber}
            onChange={handleChange}
            required
            className="form-control"
          />
        </div>
        <div className="form-group">
          <label htmlFor="email">Email:</label>
          <input
            type="email"
            id="email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
            className="form-control"
          />
        </div>
        <div className="form-group">
          <label htmlFor="address">Address:</label>
          <textarea
            id="address"
            name="address"
            value={formData.address}
            onChange={handleChange}
            required
            className="form-control"
          />
        </div>
        <div className="form-group">
          <label htmlFor="subscriptionType">Subscription Type:</label>
          <select
            id="subscriptionType"
            name="subscriptionType"
            value={formData.subscriptionType}
            onChange={handleChange}
            className="form-control"
          >
            <option value="weekly">Weekly</option>
            <option value="monthly">Monthly</option>
            <option value="daily">Daily</option>
          </select>
        </div>
        <div className="form-group">
          <label htmlFor="deliveryAreas">Delivery Areas (comma separated):</label>
          <input
            type="text"
            id="deliveryAreas"
            name="deliveryAreas"
            value={formData.deliveryAreas}
            onChange={handleChange}
            className="form-control"
          />
        </div>
        <div className="form-group">
          <label htmlFor="description">Description:</label>
          <textarea
            id="description"
            name="description"
            value={formData.description}
            onChange={handleChange}
            className="form-control"
          />
        </div>
        <button type="submit" className="submit-btn">Register Tiffin Center</button>
      </form>
    </div>
  );
  
};

export default AddTiffinCenter;
